INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLT', 'STOCK', 'Applied Therapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Applied Therapeutics, Inc. is a clinical-stage biopharmaceutical company engaged in the development of drug candidates against validated molecular targets in rare diseases. The Companys lead drug candidate, govorestat, is a central nervous system penetrant Aldose Reductase Inhibitor (ARI) for the treatment of CNS rare metabolic diseases, including classic galactosemia, sorbitol dehydrogenase (SORD) deficiency and phosphomannomutase 2 (PMM2)-congenital disorder glycosylation (CDG). The Company is also developing AT-001, an investigational, ARI developed as an oral therapy for the treatment of diabetic cardiomyopathy (DbCM). It has completed a Phase I/II clinical trial evaluating AT-001 in approximately 120 patients with type II diabetes. The Companys pipeline also includes AT-003, an ARI designed to cross through the back of the eye when dosed orally, and has demonstrated strong retinal penetrance, for the treatment of diabetic retinopathy (DR).', 'New York, NY, United States', 36);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWIN', 'STOCK', 'The Baldwin Insurance Group, Inc.', 'NMS', 'Financial Services', 'Insurance Brokers', 'The Baldwin Insurance Group, Inc. is an independent insurance distribution company. The Companys business is divided into three operating groups: Insurance Advisory Solutions (IAS), Underwriting, Capacity & Technology Solutions (UCTS) and Mainstreet Insurance Solutions (MIS). The IAS operating group provides commercial risk management, employee benefits and private risk management solutions for businesses and high-net-worth individuals, as well as their families. The UCTS operating group consists of two distinct businesses, its MGA platform (MSI) and its reinsurance brokerage business, Juniper Re. Through MSI, it manufactures proprietary, technology-enabled insurance products that are then distributed internally via risk advisors across its other operating groups and externally via select distribution partners. The MIS operating group offers personal insurance, commercial insurance and life and health solutions to individuals and businesses in their communities.', 'Tampa, FL, United States', 4000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BANC', 'STOCK', 'Banc of California, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banc of California, Inc. is a bank holding company for its subsidiary, Banc of California (the Bank), a California state-chartered bank. The Bank offers a broad range of loan and deposit products and services through 80 full-service branches located throughout California and in Denver, Colorado, and Durham, North Carolina, as well as through regional offices nationwide. The Bank also provides full-stack payment processing solutions through its subsidiary, Deepstack Technologies, LLC (Deepstack). The Bank is organized into four business groups, such as Community Banking, Specialty Banking, Deposit Services, and Payment Solutions. Specialty Banking is focused on serving clients in niche verticals by industry, including homeowner associations, venture banking, SBA lending, mortgage warehouse lending, media and entertainment and equipment finance. Deposit Services provide valuable services to clients in the Community and Specialty Banking groups.', 'Los Angeles, CA, United States', 1903);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AER', 'STOCK', 'AerCap Holdings N.V.', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'AerCap Holdings N.V. is an Ireland-based company, which is primarily engaged in aviation leasing. It provides a range of assets for leasing, including narrowbody and widebody aircraft, regional jets, freighters, engines and helicopters. It provides 10 types of modern narrowbody and widebody cargo aircraft to over 20 customers around the world, including e-commerce, express delivery and general cargo operators. It is a lessor of spare engines, with over 1,000 engines, including engines owned and managed by Shannon Engine Support Ltd (SES), its joint venture with Safran Aircraft Engines, and over 150 customers. Its offer includes new and used commercial passenger and cargo aircraft, and helicopters, on operating lease from its existing fleet and order book. In addition, it offers aftermarket components, equipment and services through its materials business and the lease, purchase and financing of spare engines. Its portfolio consists of about 3,508 aircraft, engines and helicopters.', 'Dublin, , Ireland', 698);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLDR', 'STOCK', 'Builders FirstSource, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Builders FirstSource, Inc. is a supplier of structural building products, value-added components and services to the professional market for single-family and multi-family construction and repair and remodeling. The Company provides customers an integrated homebuilding solution, offering manufacturing, supply, delivery, and installation of a full range of structural and related building products. The Company groups its building products and services into four product categories: Manufactured Products; Windows, Doors and Millwork; Specialty Building Products and Services, and Lumber and Lumber Sheet Goods. Its manufactured products are factory-built substitutes for job-site framing and include wood floor and roof trusses, wall panels and engineered wood. Its specialty building products and services consist of various products, including vinyl, composite and wood siding, exterior trim, metal studs, cement and insulation. The Company operates in approximately 43 states with 590 locations.', 'Irving, TX, United States', 29000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACB', 'STOCK', 'Aurora Cannabis Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Aurora Cannabis Inc. is a Canada-based medical cannabis company. The Companys principal business lines are focused on the production, distribution and sale of cannabis and cannabis-derivative products in Canada and internationally, and the propagation of vegetables and ornamental plants in North America. Its segments include Canadian Cannabis and Plant Propagation. The Company''s adult-use brand portfolio includes Drift, San Rafael ''71, Daily Special, Tasty''s, Being and Greybeard. Its medical cannabis brands include MedReleaf, CanniMed, Aurora and Whistler Medical Marijuana Co, as well as international brands, Pedanios, Bidiol, IndiMed and CraftPlant. It also has a controlling interest in Bevo Farms Ltd., North America''s supplier of propagated vegetables and ornamental plants in North America. Its subsidiaries include Aurora Cannabis Enterprises Inc., Aurora Deutschland GmbH, TerraFarma Inc., Whistler Medical Marijuana Corporation, and Indica Industries Pty Ltd., among others.', 'Edmonton, AB, Canada', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOCS', 'STOCK', 'Doximity, Inc.', 'NYQ', 'Healthcare', 'Health Information Services', 'Doximity, Inc. Fornece uma plataforma digital para os profissionais médicos dos Estados Unidos. Ele fornece uma plataforma on-line, que permite que médicos e outros profissionais de saúde colaborem com seus colegas, mantenham-se atualizados com as últimas notícias médicas e pesquisas e gerenciem suas carreiras. Oferece soluções de Marketing, Contratação e Produtividade para fabricantes farmacêuticos, sistemas de saúde, empresas de recrutamento médico e outras empresas de saúde. Suas soluções de marketing permitem que seus clientes farmacêuticos e de sistemas de saúde obtenham o conteúdo, serviços e conexões entre pares certos com os profissionais médicos certos através de uma variedade de módulos. Suas soluções de contratação fornecem recursos de recrutamento digital para sistemas de saúde e empresas de recrutamento médico. Suas Soluções de Produtividade incluem suas ferramentas de telesaúde, agendamento on-call e correspondência médica com suporte a inteligência artificial (IA) e são ', 'San Francisco, CA, United States', 830);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CE', 'STOCK', 'Celanese Corporation', 'NYQ', 'Basic Materials', 'Chemicals', 'A Celanese Corporation é uma empresa global de materiais químicos e especiais. A empresa é um produtor global de polímeros projetados que são usados em uma variedade de aplicações. Seus segmentos incluem materiais projetados e a cadeia de acetil. O segmento de Materiais de Engenharia da Empresa inclui o negócio de Materiais de Engenharia e certas afiliadas estratégicas. O negócio de materiais projetados desenvolve, produz e fornece um amplo portfólio de polímeros especiais de alto desempenho para aplicações automotivas e médicas, bem como produtos industriais e eletrônicos de consumo. O segmento de Cadeia de Acetil da Companhia inclui a cadeia integrada de ácido acético, monômero de acetato de vinila (VAM), anidrido acético, ésteres de acetato, polímeros de emulsão, polímeros de acetato de vinilo de etileno (EVA), pós redispersíveis (RDP) e negócios de reboque de acetato. A cadeia de acetil produz e fornece produtos acetil, incluindo ácido acético, VAM, anidrido acético e ésteres de ac', 'Irving, TX, United States', 11000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EB', 'STOCK', 'Eventbrite, Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Eventbrite, Inc. is a global events marketplace that serves event creators and event-goers in approximately 180 countries. The Company''s two-sided marketplace connects creators and consumers every month to share their passions, artistry, and causes through live experiences. The Company leverages technology and the Eventbrite brand to engage audiences and connect them in ways that help maximize business opportunities for event creators and satisfy consumer demands. The Company''s self-service ticketing and marketing tools enable creators to plan, promote, and sell tickets to their events. The Company''s Website and mobile application allow event seekers to discover and purchase tickets to experiences they enjoy. Its subsidiaries include Eventbrite UK Limited, Eventbrite International, Inc., Eventbrite Operations (IE) Limited, Eventbrite Singapore Pte. Ltd., Eventioz Holdings, Inc., Eventbrite Hong Kong Limited and Eventbrite Technologies India Private Limited.', 'San Francisco, CA, United States', 748);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASB', 'STOCK', 'Associated Banc-Corp', 'NYQ', 'Financial Services', 'Banks - Regional', 'Associated Banc-Corp is a bank holding company. The Company, through Associated Bank and various nonbanking subsidiaries, provides an array of banking and nonbanking products and services to individuals and businesses through 188 banking branches, serving more than 100 communities, primarily within its three-state branch footprint. The Corporate and Commercial Specialty segment serves a wide range of customers, including larger businesses, developers, not-for-profits, municipalities, and financial institutions by providing lending and deposit solutions as well as the support to deliver, fund, and manage such banking solutions. The Community, Consumer and Business segment serves individuals and businesses by providing lending and deposit solutions and a variety of investment, fiduciary, and retirement planning products and services. The Risk Management and Shared Services segment includes key shared operational functions and also includes residual revenue and expenses.', 'Green Bay, WI, United States', 3993);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CPLS', 'STOCK', 'AB Core Plus Bond ETF', 'NGM', NULL, NULL, 'The fund pursues its objective by investing, under normal circumstances, at least 80% of its net assets, including any borrowings for investment purposes, in fixed-income securities. It may invest in a broad range of debt securities, including corporate bonds and debt and mortgage- and other asset-backed securities issued by U.S. government-sponsored entities and federal agencies and instrumentalities that are not backed by the full faith and credit of the U.S. government.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BZAI', 'STOCK', 'Blaize Holdings, Inc.', 'NGM', 'Technology', 'Software - Application', 'Blaize Holdings, Inc. is a provider of purpose-built, artificial intelligence (AI)-enabled edge computing solutions. The Company provides a full-stack programmable processor architecture suite and a low-code/no-code software platform that enables AI processing solutions for high-performance computing at the networks edge and in the data center. Its solutions deliver real-time insights and decision-making capabilities. Its products include Blaize Pathfinder, Blaize Xplorer platforms and the Blaize AI Software Suite. It includes Blaize Xplorer X1600E EDSFF Small Form Factor Accelerator, Blaize Xplorer X600M M.2 Small Form Factor Accelerator Platform, Blaize Xplorer X1600P PCIe Accelerator, Blaize Xplorer X1600P-Q PCIe Accelerator, Blaize Pathfinder P1600 Embedded System on Module, and Blaize Pathfinder 1600-DK Embedded Kit. Its AI Studio delivers AI-driven, application end-to-end data operations (DataOps), development operations (DevOps), and Machine Learning operations (MLOps) tools.', 'El Dorado Hills, CA, United States', 232);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIQ', 'STOCK', 'Global X Artificial Intelligence & Technology ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets in the securities of the underlying index. The underlying index is designed to track the performance of companies involved in the development and utilization of artificial intelligence ("AI") and big data. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNOW', 'STOCK', 'DNOW Inc.', 'NYQ', 'Industrials', 'Industrial Distribution', 'DNOW Inc. is a supplier of energy and industrial products and packaged, engineered process and production equipment. The Company offers a set of supply chain solutions combined with a suite of digital offerings branded as DigitalNOW that provides customers access to digital commerce, data, and information management channels. It is engaged in providing application systems, work processes, parts integration, optimization solutions and after-sales support that provide productive solutions for its customers. Its product offering includes pipe, manual and automated valves, fittings, flanges, gaskets, fasteners, electrical, instrumentation, artificial lift, pumping solutions and modular process, production, measurement, automation, control equipment, and consumable maintenance, repair and operating (MRO) supplies. It also offers sourcing, procurement, warehouse, and inventory management solutions as part of its supply chain and materials management offering.', 'Houston, TX, United States', 2575);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AISP', 'STOCK', 'Airship AI Holdings, Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Airship AI Holdings, Inc. is a technology company. The Company offers an artificial intelligence (AI)-driven video, sensor and data management surveillance platform that improves public safety and operational efficiency for public sector and commercial customers by providing predictive analysis of events before they occur and meaningful intelligence to decision makers. Its product suite includes Outpost AI edge hardware and software offerings, the Acropolis enterprise management software stack, and the Command family of visualization tools. It specializes in ingesting all available metadata from edge-based sensors used by government and law enforcement agencies around the world, including surveillance cameras (video), audio, telemetry, acoustic, seismic, and autonomous devices, along with large commercial corporations with fundamentally similar capabilities and requirements. Its offerings allow customers to manage their data across the full data lifecycle, when and where they need it.', 'Redmond, WA, United States', 55);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANY', 'STOCK', 'Sphere 3D Corp.', 'NCM', 'Financial Services', 'Capital Markets', 'Sphere 3D Corp. is a Canada-based bitcoin mining company. The Company is engaged with Bitcoin mining pool operators, its customers, to provide a service to perform hash calculations for the mining pool operator. It is engaged in digital asset mining operation through the capital-efficient procurement of next generation mining equipment and partnering with data center operators.', 'Stamford, CT, United States', 2);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHKP', 'STOCK', 'Check Point Software Technologies Ltd.', 'NMS', 'Technology', 'Software - Infrastructure', 'A Check Point Software Technologies Ltd é uma empresa com sede em Israel envolvida principalmente no setor de segurança cibernética. A empresa se concentra no fornecimento de soluções de segurança baseadas em IA e entregues na nuvem para proteger empresas e governos em todo o mundo. Seu principal produto é a Check Point Infinity Architecture, que é uma plataforma abrangente de segurança cibernética. A Plataforma visa defender-se contra ataques cibernéticos de quinta geração em várias redes, endpoints, ambientes de nuvem, cargas de trabalho, Internet das Coisas (IoT) e dispositivos móveis. Além disso, a empresa oferece uma gama de produtos e serviços projetados para proteger a INFRAESTRUTURA DE TI. Ele integra tecnologias avançadas de prevenção de ameaças, incluindo firewall, sistema de prevenção de intrusão (IPS), antivírus, anti-bot e recursos de sandboxing.', 'Tel Aviv, , Israel', 6669);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ERAS', 'STOCK', 'Erasca, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Erasca, Inc. is a clinical-stage precision oncology company. The Company is focused on discovering, developing, and commercializing therapies for patients with RAS/MAPK pathway-driven cancers. The Company has assembled RAS/MAPK pathway-focused pipeline in the industry, consisting of modality-agnostic programs aligned with its three therapeutic strategies of: targeting key upstream and downstream signaling nodes in the RAS/MAPK pathway; targeting RAS directly; and targeting escape routes that emerge in response to treatment. Its pipeline includes one clinical-stage program (a pan-RAF inhibitor), two IND-enabling stage programs (a pan-RAS molecular glue and a pan-KRAS inhibitor), and an additional discovery-stage program (an EGFR D2/D3 biparatopic antibody). Its lead product candidate is naporafenib, the Company initiated its SEACRAFT-2 pivotal Phase III trial for patients with NRAS-mutated (NRASm) melanoma.', 'San Diego, CA, United States', 103);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASMG', 'STOCK', 'Themes ETF Trust - Leverage Shares 2X Long ASML Daily ETF', 'NGM', NULL, NULL, NULL, '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLCO', 'STOCK', 'Bausch + Lomb Corporation', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'Bausch + Lomb Corporation is an eye health company. It operates through three segments: Vision Care, Pharmaceuticals, and Surgical. Vision Care segment includes both a contact lens and a consumer eye care business that consists of contact lens care products, over-the-counter eye drops and eye vitamins. Pharmaceuticals segment consists of generic pharmaceutical products for post-operative treatments and treatments for a number of eye conditions, such as glaucoma, eye inflammation, ocular hypertension, dry eyes and retinal diseases. Surgical segment consists of medical device equipment, consumables, instruments and technologies for the treatment of cataracts, corneal and vitreous and retinal eye conditions, which includes delivery systems, phacoemulsification equipment and other surgical instruments and devices for cataract surgery. Its brands consist of PreserVision, Biotrue, Artelac, Alaway, Mioclear, Ocuvite, ScoutPro, XIIDRA, Vyzulta, Lotemax, Prolensa, Minims, INFUSE, and many more.', 'Vaughan, ON, Canada', 13500);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MIST', 'STOCK', 'Milestone Pharmaceuticals Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Milestone Pharmaceuticals Inc. is a Canada-based biopharmaceutical company. The Company is focused on the development and commercialization of cardiovascular medicines. Its lead product candidate, etripamil, is a potent rapid-onset calcium channel blocker that the Company designed and is developing as a rapid-onset nasal spray to be administered by patients. The Company is also focused on developing etripamil to treat paroxysmal supraventricular tachycardia, atrial fibrillation, and other cardiovascular indications.', 'Montreal, QC, Canada', 33);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGEN', 'STOCK', 'Agenus Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Agenus Inc. is a clinical-stage biotechnology company specializing in discovering and developing therapies to activate the body''s immune system against cancer and infections. The Companys pipeline includes immune-modulatory antibodies, adoptive cell therapies (via MiNK Therapeutics, Inc.), and vaccine adjuvants (via SaponiQx, Inc.). Its primary focus is immuno-oncology (I-O), and its diverse pipeline is supported by its in-house capabilities, including current good manufacturing practice (cGMP) manufacturing and a clinical operations platform. Its most advanced antibody candidates are botensilimab (a multifunctional immune cell activator and human Fc-enhanced cytotoxic T-lymphocyte antigen 4 (CTLA-4) blocking antibody) and balstilimab (a novel, fully human monoclonal immunoglobulin G4 (IgG4) PD-1 inhibitor). Its pipeline includes several classes of immunotherapies: checkpoint inhibitors, immune activators, and tumor microenvironment conditioning agents.', 'Lexington, MA, United States', 316);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBLG', 'STOCK', 'FibroBiologics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'FibroBiologics, Inc. is a clinical-stage biotechnology company. The Company is focused on developing and commercializing fibroblast-based therapies for patients suffering from chronic diseases with significant unmet medical needs, including wound healing, multiple sclerosis, degenerative disc disease, psoriasis and certain cancers, and potential human longevity applications including thymic involution reversal. Its product candidates include CybroCell, CYMS101 and CYWC628. CybroCell is an allogeneic fibroblast cell-based therapy for degenerative disc disease. This technology is being designed as an alternative method for repairing the cartilage of the intervertebral disc (or any other articular cartilage). It is developing CYMS101 as an allogeneic fibroblast cell-based therapy to treat multiple sclerosis (MS) and has completed the Phase I study. It is developing CYWC628 as an allogeneic fibroblast cell-based therapy for wound healing. Its CYPS317 is used for the treatment of Psoriasis.', 'Houston, TX, United States', 13);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EXPD', 'STOCK', 'Expeditors International of Washington, Inc.', 'NYQ', 'Industrials', 'Integrated Freight & Logistics', 'A Expeditors International of Washington, Inc. É uma empresa global de logística. Os serviços da Companhia incluem consolidação ou encaminhamento de frete aéreo e marítimo, corretagem alfandegária, consolidação de fornecedores, seguro de carga, transporte com prazo definido, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias, transporte de mercadorias e transporte de mercadorias. gestão de pedidos, armazenagem e distribuição e soluções logísticas personalizadas. Os principais serviços da Companhia incluem serviços de frete aéreo, serviços de frete marítimo e marítimo, corretagem aduaneira e outros serviços. Oferece um conjunto completo de serviços globais de logística, oferecendo aos clientes acesso a uma rede internacional de pessoas e sistemas de informação integrados para apoiar o movimento e posicionamento estratégico de mercadorias. Como fornecedor de logística terceirizado, compra espaço de carga de transportadoras em uma ba', 'Bellevue, WA, United States', 19666);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DD', 'STOCK', 'DuPont de Nemours, Inc.', 'NYQ', 'Basic Materials', 'Specialty Chemicals', 'A DuPont de Nemours, Inc. Fornece materiais e soluções baseados em tecnologia. Seu segmento de Eletrônica e Industrial é um fornecedor global de materiais e sistemas diferenciados para uma gama de eletrônicos de consumo, incluindo dispositivos móveis, monitores de televisão, computadores pessoais e eletrônicos usados em uma variedade de indústrias. O segmento fornece materiais e soluções para a fabricação e embalagem de semicondutores e circuitos integrados e fornece soluções para gestão térmica e processos de blindagem eletromagnética e metalização para aplicações de acabamento metálico, decorativo e industrial. O seu segmento de Água e Proteção fornece produtos de engenharia e sistemas integrados para uma série de indústrias, incluindo segurança dos trabalhadores, purificação e separação de água, aeroespacial, energia, embalagens médicas e materiais de construção. Suas marcas incluem NOMEX, KEVLAR, TYVEK, FILMTEC, AMBERLITE, e ISOPOR. Ele também oferece capacidades avançadas de fabri', 'Wilmington, DE, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELS', 'STOCK', 'Equity LifeStyle Properties, Inc.', 'NYQ', 'Real Estate', 'REIT - Residential', 'A Equity lifestyle Properties, Inc. É uma confiança de investimento imobiliário auto-administrada e auto-gerida (REIT). A empresa é proprietária totalmente integrada de propriedades orientadas para o estilo de vida, que consistem em operações de propriedade e vendas e operações de locação em casas manufaturadas (MH) e veículos recreativos (RV) comunidades e marinas. Atua através de dois segmentos: Operações de Propriedade e Operações de Vendas e Aluguel de Casas. O segmento de Operações de Propriedade possui e opera Propriedades arrendadas por terra. O segmento Home Sales and Rentals Operations compra, vende e aluga casas nas Propriedades. Seu portfólio é geograficamente diversificado em locais desejáveis perto de destinos de aposentadoria e férias e áreas urbanas em todos os Estados Unidos. Possui um interesse em um portfólio de aproximadamente 452 propriedades localizadas em todos os Estados Unidos e Canadá, contendo 173 201 áreas desenvolvidas individualmente (sites). Estas propried', 'Chicago, IL, United States', 3800);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CERT', 'STOCK', 'Certara, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'Certara, Inc. is a provider of biosimulation technology and solutions for using Model-Informed Drug Development (MIDD) in the global biopharmaceutical industry. It accelerates medicine using biosimulation software, technology and services to transform traditional drug discovery and development. It delivers software products and technology-driven services to customers to carry out and realize the full benefits of biosimulation in drug discovery, preclinical and clinical research, regulatory submissions and market access. Its regulatory science and market access software and services, such as regulatory submissions software, natural language processing and Bayesian analytics. It offers both mechanistic and empirical biosimulation solutions providing clients with a comprehensive offering based on their therapy goals, mechanism of action, and available data sources. Its clients include 2,400 biopharmaceutical companies, academic institutions and regulatory agencies across 70 countries.', 'Radnor, PA, United States', 1487);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AROC', 'STOCK', 'Archrock, Inc.', 'NYQ', 'Energy', 'Oil & Gas Equipment & Services', 'Archrock, Inc. is an energy infrastructure company with a primary focus on midstream natural gas compression. The Company is a provider of natural gas compression services to customers in the energy industry throughout the United States. It is a supplier of aftermarket services to customers that own compression equipment. Its segments include Contract Operations and Aftermarket Services. The Contract Operations business is comprised of its owned fleet of natural gas compression equipment that it uses to provide operations services to its customers. The aftermarket services business provides a full range of services to support the compression needs of its customers that own compression equipment, including operations, maintenance, overhaul and reconfiguration services and sales of parts and components. The Company provides comprehensive contract operations services, such as personnel, equipment, tools, materials and supplies to meet its customers natural gas compression needs.', 'Houston, TX, United States', 1300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ECC', 'STOCK', 'Eagle Point Credit Company Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Eagle Point Credit Company Inc. is a closed ended fund launched and managed by Eagle Point Credit Management LLC. It invests in fixed income markets of the United States. The fund invests equity and junior debt tranches of collateralized loan obligations consisting primarily of below investment grade U.S. senior secured loans. Eagle Point Credit Company Inc. was formed on March 24, 2014 and is domiciled in the United States.', 'Greenwich, CT, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAWN', 'STOCK', 'Day One Biopharmaceuticals, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Day One Biopharmaceuticals, Inc. is a commercial-stage biopharmaceutical company focused on developing and commercializing targeted therapies for people of all ages with life-threatening diseases. The Company partners with clinical oncologists, families, and scientists to identify, acquire, and develop cancer treatments. The Companys commercial product, OJEMDA (tovorafenib), is an oral, brain-penetrant, selective type II rapidly accelerated fibrosarcoma (RAF) kinase inhibitor of mutant BRAF V600, wild-type BRAF, and wild-type CRAF kinases. Its pipeline product candidates include DAY301 and VRK1 program. The DAY301 candidate is a PTK7 targeted ADC composed of a novel humanized anti-PTK7 immunoglobulin G1 monoclonal antibody (mAb), conjugated with a topoisomerase I inhibitor through a stable and hydrophilic modified valine-alanine (VA) cleavable linker. Its VRK1 program is a novel target involved in the regulation of cell division and DNA damage repair.', 'Brisbane, CA, United States', 182);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AHR', 'STOCK', 'American Healthcare REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'A American HEALTHCARE REIT, Inc. É uma confiança de investimento imobiliário que adquire, possui e opera um portfólio diversificado de imóveis de saúde clínica, com foco principalmente em residências seniores, instalações de enfermagem especializadas, edifícios médicos ambulatoriais (OM) e outras instalações relacionadas à saúde em todos os Estados Unidos, Reino Unido e Ilha de Man Possui e opera seus campi de saúde sênior integrados e propriedades operacionais de habitação sênior (loja). Seus segmentos incluem campus de saúde sênior integrados, OM, LOJA e propriedades alugadas triple-net. Seus edifícios OM são alugados a vários inquilinos sob arrendamentos separados. Seus campi de saúde sênior integrados fornecem uma gama de vida independente, vida assistida, cuidados de memória, serviços de enfermagem qualificados e negócios auxiliares. O seu segmento de propriedades alugadas triplas inclui habitação sénior, instalações de enfermagem especializadas e hospitais. Seu segmento DE loja i', 'Irvine, CA, United States', 114);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUB', 'STOCK', 'Atlantic Union Bankshares Corporation', 'NYQ', 'Financial Services', 'Banks - Regional', 'Atlantic Union Bankshares Corporation is the holding company for Atlantic Union Bank (the Bank), which provides banking and related financial products and services to consumers and businesses. The Bank has branches and ATMs located in Virginia, Maryland and North Carolina. It operates through two segments: Wholesale Banking and Consumer Banking. Its Wholesale Banking segment provides loan, leasing, and deposit services, as well as treasury management and capital market services to wholesale customers primarily throughout Virginia, Maryland, North Carolina, and South Carolina. These customers include commercial and industrial customers. This segment also includes its equipment finance subsidiary and its wealth management business. Its Consumer Banking segment provides loan and deposit services to consumers and small businesses throughout Virginia, Maryland, and North Carolina. Consumer Banking includes the home loan division and investment management, and advisory services businesses.', 'Glen Allen, VA, United States', 3160);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALC', 'STOCK', 'Alcon Inc.', 'NYQ', 'Healthcare', 'Medical Instruments & Supplies', 'A Alcon AG é uma empresa de oftalmologia sediada na Suíça. A Companhia pesquisa, desenvolve, fabrica, distribui e vende um conjunto completo de produtos para cuidados com os olhos em dois negócios principais: Cirúrgico e Vision Care. O negócio Cirúrgico da Companhia é focado em produtos oftálmicos para cirurgia de catarata, cirurgia vitreorretiniana, cirurgia refrativa a laser e cirurgia de glaucoma. O portfólio cirúrgico inclui implantáveis, consumíveis e equipamentos cirúrgicos necessários para esses procedimentos e atende às necessidades do cirurgião oftalmologista de ponta a ponta. O negócio Vision Care da Companhia compreende lentes de contato diárias descartáveis, reutilizáveis e que melhoram as cores e um portfólio de produtos de saúde ocular, incluindo produtos para olho seco, alergias oculares, glaucoma e cuidados com lentes de contato, bem como vitaminas oculares e aliviadores de vermelhidão. A empresa opera em 60 países e atende consumidores e pacientes em mais de 140 países', 'Geneva, , Switzerland', 25000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMEA', 'STOCK', 'Biomea Fusion, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Biomea Fusion, Inc. is a clinical-stage diabetes and obesity medicines company focused on the discovery and development of oral covalent small molecules to improve the lives of patients with diabetes, obesity, and metabolic diseases. A covalent small molecule is a synthetic compound that forms a permanent bond to its target protein. The Company has built its proprietary FUSION System discovery platform to advance a pipeline of small molecule product candidates. Its lead clinical programs drug candidate, icovamenib, is being developed as an orally bioavailable, and selective covalent inhibitor of menin in two clinical and multiple preclinical studies, investigating icovamenibs potential in type 1 and type 2 diabetes, as well as its impact in obesity. Its second product candidate BMF-650, is an investigational, oral small-molecule glucagon-like peptide-1 receptor agonists (GLP-1 RA), for the treatment of diabetes and obesity.', 'San Carlos, CA, United States', 63);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZU', 'STOCK', 'Direxion Daily AMZN Bull 2X Shares', 'NGM', NULL, NULL, 'The fund will enter into one or more swap agreements with major global financial institutions whereby the fund and the global financial institution will agree to exchange the return earned on an investment by The fund invests in AMZN that is equal, on a daily basis, to 200% of the value of the fund''s net assets. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNLI', 'STOCK', 'Denali Therapeutics Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Denali Therapeutics Inc. É uma empresa biofarmacêutica. A empresa está focada no desenvolvimento de um portfólio de candidatos a produtos projetados para cruzar a barreira hematoencefálica (BBB) para doenças neurodegenerativas e doenças de armazenamento lisossômico. A empresa possui um portfólio de medicamentos de pequena molécula e bioterapêutica, compreendendo sete candidatos a produtos em desenvolvimento clínico em sete indicações, bem como candidatos terapêuticos pré-clínicos. Seus três programas de desenvolvimento em estágio tardio incluem tividenofusp alfa (DNL310) para mucopolissacaridose II (MPS II); BIIB122/DNL151 (inibidor LRRK2) para doença de Parkinson; e DNL343 (ativador eIF2B) para esclerose lateral amiotrófica (ELA). SAR443820/DNL788 (inibidor de RIPK1) está sendo avaliado em um estudo de Fase II para esclerose múltipla (EM). Além disso, tem um estudo de Fase I/II de TAK-594/DNL593 para demência-granulina frontotemporal (FTD-GRN) e um estudo de Fase I/II de DNL126 para M', 'South San Francisco, CA, United States', 422);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVAC', 'STOCK', 'CureVac N.V.', 'NGM', 'Healthcare', 'Biotechnology', 'CureVac NV, formerly CureVac AG, is a Germany-based clinical-stage biopharmaceutical company. The Company develops transformative medicines based on messenger ribonucleic acid, or mRNA. The Company''s mRNAs are designed to prevent infections and to treat diseases by mimicking human biology to synthesize the desired proteins. Its technology platform optimizes mRNA constructs that encode functional proteins which either induce a desired immune response or replace defective or missing proteins using the cells intrinsic translation machinery. The Company''s product portfolio includes clinical and preclinical candidates across multiple disease indications in prophylactic vaccines, oncology, and molecular therapy. In prophylactic vaccines, the Company is advancing its second-generation mRNA backbone against Severe Acute Respiratory Syndrome Coronavirus 2 (SARS-CoV-2) and a range of infectious diseases, including seasonal influenza, in collaboration with GSK(Glaxo Smith Kline).', 'Tübingen, , Germany', 825);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHRW', 'STOCK', 'C.H. Robinson Worldwide, Inc.', 'NMS', 'Industrials', 'Integrated Freight & Logistics', 'C.H. Robinson Worldwide, Inc. É um fornecedor global de logística. Os segmentos da empresa incluem transporte de superfície norte-americano (NAST), Global Forwarding e todos os outros e corporativos. A NAST Segment fornece serviços de transporte e logística em toda a América do Norte através de uma rede de escritórios nos Estados Unidos, Canadá e México. Os serviços DA NAST Segment incluem carga de caminhão e serviços de corretagem de transporte de carga de caminhão. Global Forwarding Segment fornece serviços de transporte e logística através de uma rede internacional de escritórios na América do Norte, Europa, Ásia, Oceania, América do Sul, e o Oriente Médio e também contratos com agentes independentes em todo o mundo. Os serviços do segmento Global Forwarding incluem serviços de frete marítimo, serviços de frete aéreo e corretagem aduaneira. Todo o outro segmento e Corporate inclui Robinson Fresh e Managed Solutions. Robinson Fresh fornece serviços de sourcing. Em seu negócio de Solu', 'Eden Prairie, MN, United States', 13166);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EBS', 'STOCK', 'Emergent BioSolutions Inc.', 'NYQ', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Emergent BioSolutions, Inc. is a life sciences company. It is focused on providing preparedness and response solutions addressing accidental, deliberate and naturally occurring public health threats. Its solutions include a product portfolio, a product development portfolio, and a contract development and manufacturing services portfolio. Its segments include Commercial Products, MCM Products, and Services segment. Its Commercial Product segment consists of NARCAN Nasal Spray. Its MCM Products segment consists of Anthrax MCM products, Smallpox MCM products and Other Products. Its Services segment consists of its Bioservices portfolio. NARCAN (naloxone HCl) Nasal Spray, an intranasal formulation of naloxone, is developed for the emergency treatment of known or suspected opioid overdose as manifested by respiratory and central nervous system depression. Its Bioservices consist of development services, bulk drug substance manufacturing, fill, finish, and packaging of final drug products.', 'Gaithersburg, MD, United States', 900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CENX', 'STOCK', 'Century Aluminum Company', 'NMS', 'Basic Materials', 'Aluminum', 'Century Aluminum Company is a global producer of primary aluminum and operates aluminum reduction facilities, or smelters. The Company''s annual production capacity is approximately 1,020,000 tons per year (tpy). It owns a carbon anode production facility located in the Netherlands (Vlissingen). Carbon anodes are consumed in the production of primary aluminum. Vlissingen supplies carbon anodes to its aluminum smelter in Grundartangi, Iceland. Each of its aluminum smelters in the United States produces anodes at on-site facilities. Through its Natur-Al product line, it provides low-carbon aluminum products. It operates three United States aluminum smelters, in Hawesville, Kentucky (Hawesville), Robards, Kentucky (Sebree) and Goose Creek, South Carolina (Mt. Holly), and one aluminum smelter in Grundartangi, Iceland (Grundartangi). The Grundartangi facility, is an aluminum reduction facility owned and operated by the Companys wholly owned subsidiary, Nordural Grundartangi ehf.', 'Chicago, IL, United States', 2971);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EYE', 'STOCK', 'National Vision Holdings, Inc.', 'NMS', 'Consumer Cyclical', 'Specialty Retail', 'National Vision Holdings, Inc. is an optical retail company in the United States with over 1,200 stores in 38 states and Puerto Rico. The Company operates four retail brands: America''s Best Contacts & Eyeglasses, Eyeglass World, and Vista Opticals, inside select Fred Meyer stores and on select military bases. The Company''s segment includes Owned & Host. The Company, through its subsidiary, FirstSight Vision Services, Inc., is licensed as a single-service health plan under California law and issues individual vision plans in connection with its America''s Best operations in California. It offers two products and one service, such as eyeglasses, contact lenses and eye exams. The Companys e-commerce consumer Website, DiscountContacts.com, offers a range of services to customers, including eyeglass purchasing, online scheduling and appointment reminders, contact lens purchasing, buy-in-store and ship-to-home capabilities and online frame browsing, among others.', 'Duluth, GA, United States', 13411);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CARM', 'STOCK', 'Carisma Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Carisma Therapeutics Inc. is a clinical-stage biopharmaceutical company focused on macrophage engineering to develop transformative therapies to treat serious diseases including liver fibrosis and cancer. The Company seeks to apply the ability to engineer macrophages and monocytes, either in vivo or ex vivo. Its proprietary chimeric antigen receptor macrophages(CAR-M) platform uses CARs to redirect macrophages or monocytes against specific tumor associated antigens with the goal of targeted antitumor immunity. It is developing a pipeline of product candidates which includes CT-1119, In Vivo CAR-Macrophage: GPC3+ Solid Tumors, In Vivo CAR-Macrophage: Oncology Targets, and CT-2401 (Liver Fibrosis). CT-2401 is a product candidate in development for liver fibrosis, and CT-1119 is a mesothelin-targeted CAR-Monocyte that is designed to treat patients with advanced mesothelin-positive solid tumors, including pancreatic cancer, ovarian cancer, lung cancer, mesothelioma, and others.', 'Philadelphia, PA, United States', 46);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTLP', 'STOCK', 'Cantaloupe, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Cantaloupe, Inc. is a global provider of technology solutions for self-service commerce. The Companys vertically integrated solutions fuel growth by offering micro-payments processing, enterprise cloud software, IoT technology, as well as kiosk and POS innovations. It offers a variety of solutions for self-service commerce, which enable the acceptance of digital payments and allow its customers to simplify inventory, analytics, warehouse, logistics, and back-office management. Its hardware includes Cantaloupe card readers, the Companys integrated payment device, as well as Cantaloupe Go POS kiosks, the Companys range of POS terminals, which are both deployed in self-service, applications, such as vending, micro-markets, amusement, air/vacuum, car wash, and others. Its Cantaloupe Go product line provides a variety of self-checkout kiosks. Its solutions are used by a variety of consumer services in the United States, the United Kingdom, European Union countries, Australia, and Mexico.', 'Malvern, PA, United States', 375);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWA', 'STOCK', 'BorgWarner Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'BorgWarner Inc. Está envolvida em soluções de tecnologia limpa para veículos de combustão, híbridos e elétricos. A Companhia atua em quatro segmentos. As tecnologias da Turbos & Thermal Technologies incluem turbocompressores, e-boosters, e-turbos, sistemas de emissões, sistemas térmicos, tecnologia de ignição a gasolina, atuadores remotos inteligentes, sensores do grupo motopropulsor, entre outros. Os produtos do segmento Drivetrain & Morse Systems incluem módulos de controle, produtos de embreagem mecânica e de fricção para transmissões automáticas, produtos de gerenciamento de torque e sistemas de caixa de transferência de tração traseira (RWD) e tração integral (AWD) e sistemas de acoplamento. Os produtos do segmento Powerdrive Systems incluem eletrônicos de energia, como inversores, carregadores de bordo, conversores DC/DC e caixas de combinação, entre outros. Os produtos do segmento de baterias e sistemas de carregamento incluem sistemas de baterias de iões de lítio para aplicaçõe', 'Auburn Hills, MI, United States', 38300);\n